using System;
using System.Collections.Generic;
using System.Text;
using GildedRose.Web.Data.DatabaseModels;
using GildedRose.Web.Data.DatabaseModels.FileStore;
using GildedRose.Web.Data.DatabaseModels.Products;
using GildedRose.Web.Data.DatabaseModels.Transactions;
using GildedRose.Web.Data.DatabaseModels.Users;
using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;

namespace GildedRose.Web.Data
{
    public class GildedRoseDbContext : IdentityDbContext<User, IdentityRole<Guid>, Guid>
    {
        public GildedRoseDbContext(DbContextOptions<GildedRoseDbContext> options)
            : base(options)
        {

        }

        public DbSet<Transaction> Transactions { get; set; }

        public DbSet<Product> Products { get; set; }

        public DbSet<ProductImage> ProductImages { get; set; }

        public DbSet<ImageFile> ImageFiles { get; set; }

        protected override void OnModelCreating(ModelBuilder builder)
        {

            var diademId = Guid.Parse("de60a276-cc1d-4dfe-aab5-057f0b63fad6");
            var diademProductImageId = Guid.Parse("de61a276-cc1d-4dfe-aab5-057f0b63fad6");
            var diademProductImageId2 = Guid.Parse("de61a276-cc1d-4dfe-aab5-057f0b63fad7");
            var diademImageId = Guid.Parse("fe62a276-cc1d-4dfe-aab5-057f0b63fad6");
            var diademImageId2 = Guid.Parse("ee62a276-cc1d-4dfe-aab5-057f0b63fad7");
            
            builder.Entity<Product>().HasData(new Product()
            {
                Id = diademId,
                Name = "Gold Diadem",
                StockCount = 27,
                Description = "This Golden Diadem can be worn for many occasions, such as fairs and festivals.",
                DateCreated = DateTime.UtcNow,
                ItemNumber = "0111022342340",
                UnitCost = 29.99
            });
            builder.Entity<ImageFile>().HasData(new ImageFile()
            {
                Id = diademImageId,
                Base64ImageContent =
                    "data:image/jpeg;base64,"
            });
            builder.Entity<ImageFile>().HasData(new ImageFile()
            {
                Id = diademImageId2,
                Base64ImageContent =
                "data:image/jpeg;base64,"
            });

            builder.Entity<ProductImage>().HasData(new ProductImage()
            {
                Id = diademProductImageId,
                ImageFileId = diademImageId,
                Order = 1,
                ProductId = diademId
            });
            builder.Entity<ProductImage>().HasData(new ProductImage()
            {
                Id = diademProductImageId2,
                ImageFileId = diademImageId2,
                Order = 1,
                ProductId = diademId
            });

            base.OnModelCreating(builder);
        }
    }



}
